import React from 'react';

function randomName() {
  const names = [
    "George",
    "Rosa",
    "Alexander",
    "Amelia",
    "Winston",
    "Cleopatra",
    "Abraham",
    "Marilyn",
    "Nelson",
    "Leonardo",
    "Joan",
    "Albert",
    "Marie",
    "Martin",
    "Elizabeth",
    "Thomas",
    "Florence",
    "William",
    "Mahatma",
    "Genghis",
  ];

  const name = names[Math.floor(Math.random() * names.length)];
}

const RandomNames = () => {
  const name = randomName();
  return (
    <div>
      <h2>Random Name Component</h2>
      <p>Selected Name: {name}</p>
    </div>
  );
};

export default RandomNames;
